import React from 'react'
import PropTypes from "prop-types"

import Container from "./container"
import FilterButton from "./filter-button"

const Filter = ({ category, handleCategoryChange }) => {
  const [categories, setCategories] = React.useState([
    {
      id: "develop-code",
      name: "Develop Code"
    },
    {
      id: "enable-experiences",
      name: "Enable Experiences"
    },
    {
      id: "build-brands",
      name: "Build Brands"
    },
    {
      id: "design-products",
      name: "Design Products"
    },
    {
      id: "create-art",
      name: "Create Art"
    },
    {
      id: "cook-food",
      name: "Cook Food"
    },
    {
      id: "write-articles",
      name: "write-articles"
    },
    {
      id: "make-music",
      name: "Make Music"
    }
  ])
  return (
    <>
      <Container className="container">
        {categories.map(c => (
          <FilterButton key={c.id} category={c} isActive={c.id === category} handleClick={handleCategoryChange} />
        ))}
      </Container>
      <style jsx>
        {`
          .container {
            <div className="container">
          }
        `}
      </style>
    </>
  )
}

Filter.propTypes = {
  category: PropTypes.string,
  handleCategoryChange: PropTypes.func
}

export default Filter
